import React from 'react'
import './Freetrial.scss'
import {useState} from 'react'
import Footer from "components/footers/MiniCenteredFooter2.js";
import Header from "components/headers/light2.js";
import styled from "styled-components";
//import Header from "./header2";
import gratuit from '../../images/sanoGratuit.png'
//import { FontAwesomeIcon } from '@fortawesome/react-fontawesome/'

function Freetrial() {

  const [n, setNumber] = useState(0)
  const [quizStart, setQuizStarted] = useState(false);
  
  const [goal, setGoal] = useState()
  const [goal2, setGoal2] = useState()
  const [veg, setVeg] = useState()
  const [whey, setWhey] = useState()
  const [work, setWork] = useState()
  const [actv, setActv] = useState()
  const [gender, setGender] = useState()
  const [Taille, setTaille] = useState()
  const [age, setAge] = useState()
  const [poid, setPoid] = useState()

  

  function hundleStart() {
    setQuizStarted(true)
    setNumber(n+1)
  }


  function hundleQuizz(x){
  if (x == 1) {
    setGoal("lose")
  }
  if (x == 2) {
    setGoal("gain")
  }
  if (x == 3) {
    setGoal('maintain')
  }
  if (x == 4) {
    setGoal2('testo')
  }
  if (x == 5) {
    setGoal2('brain')
  }
  if (x == 6) {
    setGoal2('energie')
  }
  if (x == 7) {
    setVeg(true)
  }
  if (x == 8) {
    setVeg(false)
  }
  if (x == 9) {
    setWhey(true)
  }
  if (x == 10) {
    setWhey(false)
  }
  if (x == 11) {
    setWork(0)
  }
  if (x == 12) {
    setWork(1)
  }
  if (x == 13) {
    setWork(2)
  }
  if (x == 14) {
    setWork(3)
  }
  if (x == 15) {
    setActv(0)
  }
  if (x == 16) {
    setActv(1)
  }
  if (x == 17) {
    setActv(2)
  }
  if (x == 18) {
    setActv(3)
  }
  if (x == 19) {
    setGender('homme')
  }
  if (x == 20) {
    setGender('femme')
  }

  setNumber(n+1)
  }


 
  console.log(goal);
  console.log(goal2); 
  console.log(veg);
  return (
    <div className='free'>
      
<HeaderStyle>
   <Header />
</HeaderStyle>
<div className={`change-back ${n==0}`}>
   <div className="test">
    <div className={`text ${quizStart? 'invisible' :''}` }>
    <img src={gratuit} alt="" />
    <div className={`text-card` }>
      <div className="text-card-wrapper">
      <h2> <b> Questionnaire Gratuit</b>
      </h2>
      <span className='small-text'> <b>Pour adolescent, adultes, sportif et sédentaire.</b></span>
<b>
      <p> {/* <FontAwesomeIcon icon="fa-solid fa-check" /> */} Analyse complète de tes habitudes alimentaires </p>
          
      <p> {/* <FontAwesomeIcon icon="fa-solid fa-check" />  */}Prise en compte de tes objectifs</p>

      <p> {/* <FontAwesomeIcon icon="fa-solid fa-check" />  */}Repas et colation de ta journée type</p>
      
      </b>
     <button onClick={()=> hundleStart() }>
      <b> Démarer</b>
     </button>
</div>
    </div>
    </div>

    <div className={`quiz ${quizStart? '':'invisible'}`}>

      <div className={`questions ${n==1? '':'invisible'}`}>
      <h1>Quels sont tes objectifs estétiques ?</h1>
      <button onClick={()=> hundleQuizz(1)}>Perdre du poid.</button>
      <button onClick={()=> hundleQuizz(2)}>Prise de masse.</button>
      <button onClick={()=> hundleQuizz(3)}>Maintenir mon poid actuel.</button>
      </div>

      <div className={`questions ${n==2? '':'invisible'}`}>
      <h1>As-tu d'autres objectifs ?</h1>
      <button onClick={()=> hundleQuizz(4)}>Maximiser ma testostérone.</button>
      <button onClick={()=> hundleQuizz(5)}>Améliorer les capacité du cerveau.</button>
      <button onClick={()=> hundleQuizz(6)}>Mieux dormir (Récupération et reduire mes insomnies).</button>
      </div>

      <div className={`questions ${n==3? '':'invisible'}`}>
      <h1>Es-tu vegetarien ? ?</h1>
      <button onClick={()=> hundleQuizz(7)}>Oui</button>
      <button onClick={()=> hundleQuizz(8)}>Non</button>
      </div>

      <div className={`questions ${n==4? '':'invisible'}`}>
      <h1>Consome tu de la whey ?</h1>
      <button onClick={()=> hundleQuizz(9)}>Oui</button>
